INSERT INTO `products` (`id`, `name`, `image`, `category`, `description`, `note`, `available`, `created_at`, `updated_at`) VALUES
(3, 'Tangria Hot Stones', 'Tangria Hot Stonesc708d6ee460e820aa39c19eab69961f3e12de932.jpg', 'ala_carte_treatment', 'Hot Stone Massage yaitu massage seluruh tubuh dengan media batu panas dan juga diletakan di titik-titik cakra tubuh. Yang bermanfaat untuk memberi rasa hangat pada tubuh dan memberikan efek rasa rilex serta tenang pada fikiran karena ketegangan akan terasa mencair dan berkurang seiring dengan memudarnya rasa hangat dari batu secara perlahan. Treatment ini berdurasi waktu 1,5 jam.', 'Tidak dianjurkan bagi yang memiliki penyakit jantung.\r\nTidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-01-22 00:16:56', '2019-02-23 00:58:30'),
(7, 'Tangria Signature Massage', 'Tangria Signature Massage87e56a2319f7c923521d296b2185d2ae0045c0a1.jpg', 'package_treatment', 'Tangria Signature Massage yaitu paket perawatan tubuh dengan durasi waktu 3 jam yang meliputi Herbal stamp massage (pijat dengan media jamu hangat) dilanjut dengan 2 pilihan metode: metode 1 yaitu lulur vulcano, masker vulcano lalu dibalut dengan heating blanket yang bermanfaat untuk sleaming. Metode ke 2 yaitu lulur spicy, masker spicy lalu di balut dengan daun pisang yang bermanfaat untuk kesehatan.', 'Tidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-01-23 03:17:56', '2019-08-11 09:43:00'),
(5, 'Hair Care (Hair Spa)', 'Hair Care (Hair Spa)e5f52b33972563785da338383402ed614d95672c.jpg', 'ala_carte_treatment', 'Hair spa merupakan perawatan rambut yang membantu mengatasi berbagai masalah rambut rusak seperti rambut kering, kusam, berminyak, sampai kaku. Perawatan ini  ditujukan untuk memberi nutrisi pada akar rambut, merevitalisasi kulit kepala, serta menguatkan folikel rambut sehingga menjadikan rambut Anda sehat secara keseluruhan. Trearment ini berdurasi 1,5 jam.', 'Tidak dianjurkan jika baru melakukan pewarnaan dan pelurusan.', 'true', '2019-01-22 21:10:09', '2019-02-28 23:42:06'),
(8, 'Tangria Essence Massage', 'Tangria Essence Massagecade34d8bd8d61d9cc1b24ae637830f1b7330111.jpg', 'package_treatment', 'Tangria Essence Massage yaitu paket seluruh tubuh yang meliputi javanese massage (pijat tehnik ala jawa) dilanjut dengan lulur coklat lalu masker coklat dan diakhiri berendam dengan pilihan milk bath / herbal bath.', 'Tidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-01-24 19:15:47', '2019-02-26 03:16:48'),
(9, 'Rejuvenate Massage (Javanese Massage)', 'Rejuvenate Massage (Javanese Massage)0c97ae9195fa0a3208d733581764b49f02df1ab0.jpg', 'ala_carte_treatment', 'Rejuvenate Massage (Javanese massage) yaitu pijat seluruh tubuh dengan pijat tehnik ala jawa dengan tekanan yang kuat. Yang bermanfaat untuk melancarkan peredaran darah dan getah bening. Sangat cocok untuk anda yang suka pijat dan sedang kelelahan. Treatment ini berdurasi waktu 1 jam.', 'Tidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-02-09 20:47:33', '2019-02-24 21:37:18'),
(10, 'Fresh Face (Refreshing Facial)', 'Fresh Face (Refreshing Facial)f49b3580c9e8a101e0dcc893ab21afdb6abba8b0.jpeg', 'ala_carte_treatment', 'Fresh Face (Refreshing Facial) electrical equipment adalah prosedur perawatan wajah untuk mengatasi masalah pada kulit anda. Facial ini menggunakan metode alat listrik yang disesuaikan dengan masalah kulit. Masalah kulit wajah ini dapat berkaitan dengan kulit berjerawat/ berkomedo, kulit berminyak, kulit kering, kulit sensitive. sementara prosedur yang dilakukan yaitu meliputi pembersihan, eksfoliasi, pemijatan, pemencetaan komedo, pemberian masker kecantikan, dan pemberian nutrisi. Facial sangat bermanfaat untuk kebersihan dan kesehatan kulit wajah sehingga anda tampil lebih percaya diri. treatment ini berdurasi 75-menit.', 'Tidak dianjurkan jika kulit wajah sedang berjerawat meradang.', 'true', '2019-02-09 20:53:55', '2019-02-25 03:36:54'),
(11, 'Foot Forward', 'Foot Forwardfb74cd08560d24216e291d5917d0202e896e10b0.jpeg', 'ala_carte_treatment', 'Reflexology adalah Sebuah metode pijat yang bertumpu pada simpul syaraf kaki atau biasa disebut titik sentra reflex. Hal ini diyakini bahwa energy berjalan melalui tubuh disaluran yang dikenal sebagai merdian dan pijat kaki merangsang saluran energy ini untuk penyembuhan dan relaksasi. Treatment ini berdurasi 30 menit.', 'tidak di anjurkan untuk wanita hamil.', 'true', '2019-02-09 20:54:30', '2019-02-28 23:35:27'),
(12, 'Twinkle Nail & Twinkle Toes (Manicure & Pedicure)', 'Twinkle Nail & Twinkle Toes (Manicure & Pedicure)9c23cd85a247ef48d5ef45205eab7383a031698f.jpg', 'ala_carte_treatment', 'Twinkle Nail & Twinkle Toes (Manicure &Pedicure) yaitu perawatan tangan dan kaki yang terdiri dari pembersihan, pembentukan kuku, pembersihan kutikula, massage tangan dan kaki, dan diakhiri dengan pewarnaan kuku. Bukan hanya sekedar mempercantik penampilan tangan dan kaki, manicure dan pedicure bermanfaat untuk menjaga kuku agar tidak mudah rapuh dan menjaga kesehatan kuku. Treatment ini berdurasi waktu 1,5 jam.', 'tidak dianjurkan jika tangan dan kaki sedang mengalami luka.', 'true', '2019-02-09 20:56:30', '2019-02-23 01:05:06'),
(13, 'Total Hand and Foot Spa', 'Total Hand and Foot Spa62a1026e9215388909a9694874fdf7887f969c4c.jpg', 'ala_carte_treatment', 'Total Hand and Foot Spa yaitu perawatan tangan dan kaki yang terdiri dari pembersihan, pembentukan kuku, pembersihan kutikula, scrub, massage tangan dan kaki, masker dan diakhiri dengan pewarnaan kuku. Bukan hanya sekedar mempercantik penampilan tangan dan kaki, manicure dan pedicure bermanfaat untuk menjaga kuku agar tidak mudah rapuh dan menjaga kesehatan kuku. Treatment ini berdurasi waktu 2jam', 'tidak dianjurkan jika tangan dan kaki sedang mengalami luka.', 'true', '2019-02-09 20:57:26', '2019-02-24 21:38:09'),
(14, 'Tangria Stamps', 'Tangria Stampsb33bb5caf686422874107afa1a73108bc6582ef9.jpg', 'ala_carte_treatment', 'Tangria Stamps yaitu massage menggunakan body compress yang terbuat dari bahan herbal berupa daun dan rempah-rempah yang berkhasiat untuk melancarkan peredaran darah serta memberikan efek terapi pada raga atau fisik serta pikiran, mengobati pegal linu, nyeri otot, serta meringankan sakit di daerah punggung. Berkhasiat juga agar kulit terasa lebih halus, segar dan harum. Treatment ini berdurasi 1,5 jam.', 'Tidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-02-09 21:07:57', '2019-02-28 23:19:32'),
(15, 'Relaxing Massage', 'Relaxing Massage5ae0eb1067c6e0331623c790678abbd2ee74f0b2.jpg', 'ala_carte_treatment', 'Swedish Massage yaitu Teknik pijat ala Swedia dengan melakukan penekanan tidak terlalu keras dan cenderung lembut dengan gerakan mengayun. Dengan sentuhan lembut dapat menenangkan tubuh, pikiran, dan membawa tubuh Anda menuju tingkat relaksasi tertentu. Pemijatan ini menggunakan telapak tangan yang ditekankan pada otot dan tulang. Treatmen ini berdurasi 1 jam.', 'Tidak dianjurkan untuk wanita hamil dibawah 4 bulan. \r\nTidak dianjurkan untuk wanita menstruasi hari 1-2.', 'true', '2019-02-09 21:09:23', '2019-03-01 00:04:07');
